import logo from './logo.svg';
import './App.css';
import Header from './components/Header';
import Footer from "./components/Footer";
import { Routes, Route } from 'react-router-dom';
import { Page } from './components/Page';
import { Container } from "@mui/material";
import Homepage from "./components/Homepage";
import Nav from "./components/navigation/Nav";
import useDfpSlot from './components/Adv';

function App() {
    useDfpSlot({
        path: '/21737763597/adunit-1',
        size: [320, 100],
        id: 'div-gpt-ad-1559997122392-0',
    });
  return (
    <div className="App" >
        <div
            id="div-gpt-ad-1559997122392-0"
            style={{ width: '320px', height: '100px' }}
        />
        <Nav />
        <useDfpSlot />
        <Container fixed sx={{
            backgroundColor: '#fafafa',
            margin: '1% auto',
            padding: '3%',
            border: '1px solid rgba(0,0,0,0.1)'
        }}>
                <Routes>
                    <Route index element={<Homepage />} />
                    <Route path="*" element={<Page number={1} />} />
                    <Route path="two" element={<Page number={2} />} />
                    <Route path="three" element={<Page number={3} />} />
                    <Route path="four" element={<Page number={4} />} />
                </Routes>
        </Container>
    </div>
  );
}

export default App;
